import React from "react";
import styled from "styled-components";
import { Home, Send, Compass, Heart } from "../../../styles/Icons";
const Container = styled.div`
    display: flex;
`;
const RouteIcons = () => {
    return (
        <Container>
            <Home />
            <Send />
            <Compass />
            <Heart />
        </Container>
    );
};

export default RouteIcons;
